CustomModel = """
import egglib
from random import shuffle as random_shuffle

class ErrorModel:

    name = "ErrorModel"
    parameters = ["THETA", "MIGR", "RATE", "[RHO]"]

    def __init__(self, recombination=False):
        self.recombination = recombination
        if recombination:
            self.parameters = ["THETA", "MIGR", "RATE", "RHO"]
            self.name += 'R'
        else:
            self.parameters = ["THETA", "MIGR", "RATE"]

    def generate(self, cfg, ps, random):
        
        if len(ps)!=3 + self.recombination:
            raise ValueError, 'invalid number of parameters for %s' %self.name
            
        ds = egglib.fitmodel.Dataset()
        for ns, nsi, nso, ls in cfg:
            if len(nsi)!=2:
                raise ValueError, '%s expects two populations exactly' % self.name
            if ps[2]<0 or ps[2]>1:
                raise ValueError, 'invalid error rate'

            mutator = egglib.simul.CoalesceFiniteAlleleMutator(ps[0]*ls)
            coalParamSet = egglib.simul.CoalesceParamSet(nsi, M=ps[1])
            align = egglib.simul.coalesce(coalParamSet, mutator, 1, random)[0]
            S = align.ls()
            for item in align:
                x = int(round(random.uniform() * S * ps[2]))
                if x>0:
                    pos = range(S)
                    random_shuffle(pos)
                    pos = pos[:x]
                    seq = list(item.sequence)
                    for i in pos:
                        seq[i] = 'C' if seq[i]=='A' else 'A'
                    item.sequence = ''.join(seq)
            ds.add(align)

        return ds
"""

